import "./Card.scss";

const Card = (props) => {
  const { card } = props;
  return (
    <>
      <li className="card-item">
        {card.image && (
          <img
            className="card-cover"
            src={card.image}
            onMouseDown={(event) => event.preventDefault()}
          />
        )}
        {card.title}
        <div className="card-item-info">
          <span>so hiep </span>
          <span>thong tin</span>
        </div>
      </li>
    </>
  );
};
export default Card;
